"""#### Veri tabanı nedir?
Veritabanı uygulamalarımızda , websitelerimizde veya en genel anlamda programlarımızda gerekli olan bilgileri depoladığımız bir yapıdır.Veri tabanına ulaşabilmek için DBMS(Database Management System) ihtiyacımız vardır.

![sql-server-2016.png](data:image/png;base64,)

Resim = https://learn.microsoft.com/en-us/sql/sql-server/what-s-new-in-sql-server-2016?view=sql-server-ver16 'den alınmıştır.

#### DBMS(Database Management System)  nedir?
DBMS veri tabanı yönetim sistemidir. Temelde iki tip DBMS vardır. İlki ilişkisel veri tabanları (RDBMS), ikincisi ilişkisel olmayan veri tabanları (NRDBMS). Bizim bu Jupyter  not defterinde ilgileneceğimiz konu ilişkisel bir veri tabanı tasarlama, kodlama  ve uygulama. İlişkisel veritabanları, her türlü veriyi oluşturmak, okumak, güncellemek ve silmek için son derece verimli, güçlü ve yaygın olarak kullanılan bir yoldur.

Resim = https://codewave.com/insights/nagesh-on-when-to-use-mongodb-and-why/ 'den alınmıştır.

![download11.jpg](data:image/jpeg;base64,)

#### Python ile SQL
Veri Analistleri ve Veri Bilimcileri için Python'un birçok avantajı vardır. Çok çeşitli açık kaynaklı kütüphaneler, kolay öğrenilebilen bir dil olması ve çok yönlülüğü onu herhangi bir Veri Analisti için inanılmaz derecede yararlı bir araç haline getirir. Dolayısıyla, veri analizi için Python kullanıyorsak, tüm bu veriler nereden geliyor?

İlişkisel veri tabanları sayesinde depoladığımız verilere RDBMS yardımıyla erişmek ve değişiklik yapmak için SQL kullanılır.

SQL(Structured Query Language) yapılandırılmış sorgu dili anlamına gelmektedir. SQL veri tabanıyla konuşabilmemiz için tasarlanmış bir dildir. Her RDBMS'nin biraz farklı bir SQL türü kullanır. Bu nedenle biri için yazılan SQL kodu genellikle (normalde oldukça küçük) değişiklikler olmadan diğerinde çalışmaz. Ancak kavramlar, yapılar ve işlemler büyük ölçüde aynıdır.

Tüm yazılım uygulamaları , en yaygın olarak bir veritabanı yönetim sistemi (DBMS) aracılığıyla verilerle etkileşime girer . Bazı programlama dilleri, bir DBMS ile etkileşim kurmak için kullanabileceğiniz modüllerle gelirken, diğerleri üçüncü taraf paketlerin kullanılmasını gerektirir.
Python SQL Kütüphaneleri aracılığıyla herhangi bir veritabanıyla etkileşime geçebilen bir dildir. En yaygın SQL kütüphaneleri SQLite , MySQL ve PostgreSQL’dir. SQLite için herhangi bir harici Python SQL modülü kurmanız gerekmediğinden, muhtemelen Python için en basit veritabanıdır. Veritabanı konusu çok çok uzun incelenmesi gereken bir konu olduğundan dolayı, bu bölümde sadece SQLite veritabanını inceleyeceğiz.

#                                                            SQLITE3

SQLite veritabanı diğer veritabanları gibi sunucu kurmamızı gerektirmez yani herhangi bir programımızın yanına direk olarak kurulabilir. Peki bu veritabanı üzerinde tablo oluşturma, veri ekleme-silme, operatör gibi işlemlerimizi nasıl gerçekleştireceğiz ?

###### SQLite3'te Syntax Kuralları
Küçük ve büyük harf duyarlılığı yoktur. GLOBAL = global

##### SQLITE Veri tabanlarına bağlantı kurma
"""

#Eğer yoksa ülkeverileri.db adında yeni bir veritabanı oluşturulur, eğer mevcut ise bu veritabanına bağlantı yapılır:

sqlConn = sqlite3.connect('ülke_verileri.db')

# connect() fonksiyonu veri tabanlarına bağlantı kurulumunda kullanılan methoddur.

type(sqlConn)

"""###### İşaretçi (imleç) tanımlama;"""

# Veritabanı dosyası üzerinde işlemler yapılabilmesi için bir işaretçi (imleç) tanımlanır.

imlec = sqlConn.cursor()

# imleç olmadan fonksiyonlardan sonuç almak mümkün değildir.

type(imlec)

